  fullName: com.azure.cosmos.implementation.guava25.collect.RangeMap<K,V>
  type: Interface
  package: com.azure.cosmos.implementation.guava25.collect
  summary: >-
    A mapping from disjoint nonempty ranges to non-null values. Queries look up the value associated with the range (if any) that contains a specified key.


    In contrast to <xref uid="com.azure.cosmos.implementation.guava25.collect.RangeSet" data-throw-if-not-resolved="false">RangeSet</xref>, no "coalescing" is done of <xref uid="com.azure.cosmos.implementation.guava25.collect.Range.isConnected(com.azure.cosmos.implementation.guava25.collect.Range&lt;C&gt;)" data-throw-if-not-resolved="false">connected</xref> ranges, even if they are mapped to the same value.
