- uid: com.azure.cosmos.implementation.guava25.collect.RangeMap.putCoalescing(com.azure.cosmos.implementation.guava25.collect.Range<K>,V)
  id: putCoalescing(com.azure.cosmos.implementation.guava25.collect.Range<K>,V)
  artifact: com.azure:azure-cosmos:4.4.0-beta.1
  parent: com.azure.cosmos.implementation.guava25.collect.RangeMap
  langs:
  - java
  name: putCoalescing(Range<K> range, V value)
  nameWithType: RangeMap<K,V>.putCoalescing(Range<K> range, V value)
  fullName: com.azure.cosmos.implementation.guava25.collect.RangeMap<K,V>.putCoalescing(Range<K> range, V value)
  overload: com.azure.cosmos.implementation.guava25.collect.RangeMap.putCoalescing*
  type: Method
  package: com.azure.cosmos.implementation.guava25.collect
  summary: >-
    Maps a range to a specified value, coalescing this range with any existing ranges with the same value that are <xref uid="com.azure.cosmos.implementation.guava25.collect.Range.isConnected" data-throw-if-not-resolved="false">connected</xref> to this range.


    The behavior of <xref uid="com.azure.cosmos.implementation.guava25.collect.RangeMap.get*" data-throw-if-not-resolved="false">get(k)</xref> after calling this method is identical to the behavior described in <xref uid="com.azure.cosmos.implementation.guava25.collect.RangeMap.put*" data-throw-if-not-resolved="false">put(range, value)</xref>, however the ranges returned from <xref uid="com.azure.cosmos.implementation.guava25.collect.RangeMap.asMapOfRanges" data-throw-if-not-resolved="false">#asMapOfRanges</xref> will be different if there were existing entries which connect to the given range and value.


    Even if the input range is empty, if it is connected on both sides by ranges mapped to the same value those two ranges will be coalesced.


    **Note:** coalescing requires calling `.equals()` on any connected values, which may be expensive depending on the value type. Using this method on range maps with large values such as <xref uid="java.util.Collection" data-throw-if-not-resolved="false">Collection</xref> types is discouraged.
  syntax:
    content: public abstract void putCoalescing(Range<K> range, V value)
    parameters:
    - id: range
      type: com.azure.cosmos.implementation.guava25.collect.Range<K>
    - id: value
      type: V
